import { makeAutoObservable, observable } from "mobx";

class PostDialogStore {
    visible
    constructor() {
        makeAutoObservable(this, {
            visible: observable
        })
        this.visible = false
    }
    open() {
        // alert('open')
        console.log(this.visible)
        this.visible = true
        console.log(this.visible)
    }
}

export default new PostDialogStore()
